import Common from './Common';
const About = () =>{
    return <>
      <Common 
      name='ℍ𝕖𝕪!! 𝕎𝕖𝕝𝕔𝕠𝕞𝕖 𝕥𝕠'
      text='𝓐𝓫𝓸𝓾𝓽 𝓟𝓪𝓰𝓮'
      visit='contact'
      btname='Contact Now'/>
    </>
}
export default About;
